import React from "react";
import logotipo from "../assets/logotipo.png";

function Header() {
  return (
    <div>
      <header>
        <img src={logotipo} alt="Logotipo da Attach digital" />
        <button className="btn btn-outline-primary">ENTRAR EM CONTATO</button>
      </header>
    </div>
  );
}

export default Header;
